import axios from 'axios'
import { createActions } from 'redux-actions'


const types = {
    LOGINFAILD: 'auth/LOGINFAILD',
    LOGINSUCCESS: 'auth/LOGINSUCCESS',
}

const creators = createActions({
    [types.LOGINFAILD]: () => ({}),
    [types.LOGINSUCCESS]: () => ({})
})
